import React from 'react';

const Events = () => {
return (
    <>
		<div className='container'
		   style={{
			display: 'flex',
			justifyContent: 'center',
			alignItems: 'center',
			height: '100vh'
		}}>
			<div className='box'>
				<h1>Eve</h1>
			</div>
		</div>
	</>
);
};

export default Events;
